column8:
一酸化炭素の不完全燃焼をアラーム音で警告。<br>
検知濃度が基準を超えると警告音とランプでお知らせ！<br>
<br>
【感知濃度】<br>
一酸化炭素50ppmが約一時間続いた場合：警告音とランプ点滅<br>
一酸化炭素100ppmが約10分～40分続いた場合：警告音とランプ点滅<br>
一酸化炭素300ppmが約3分間続いた場合：警告音とランプ点滅<br>
<br>
電池を入れて固定するだけ簡単設置！<br>
単3電池を3本入れて固定するだけ！<br>
電池切れの際は約30秒毎にアラーム音でお知らせしてくれるので安心です。<br>
<br>
電源：単3電池×3本(別売り)<br>
サイズ(約)：10cm×4cm<br>
材質：プラスチック<br>
動作環境：4～38度<br>
湿度：25～85%<br>
重量(約)：90g<br>
付属品：取り付けネジ、英語説明書<br>
<br>
※日本語説明書は付属しておりません。<br>
※液晶画面は電源を入れた後にすぐに消えます。(待機モードになります。)<br>
※正常に動作中は緑のLEDが約30秒おきに点滅します。<br>
<br>
※こちらの商品はメール便発送にて送料無料です。<br>
※ゆうメールでの発送は（ポスト投函）代金引換、日付指定はできませんのでご了承ください。<br>
※仕様は改善の為に予告なく変更する場合があります。<br><style>
